import React, { Component } from "react";

class Table extends React.Component {
  render() {
      const {headers, data} = this.props
    return (
      <>
        <table class="table">
          <thead>
            <tr>
                {
                    this.headers.map(header => {
                        return (
                            <>
                            <th>{header}</th>
                            </>
                        )
                    })
                }
              <th>#</th>
              <th>First</th>
              <th>Last</th>
              <th>Handle</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <td>2</td>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <td>3</td>
              <td>Larry</td>
              <td>the Bird</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </table>
      </>
    );
  }
}

export default Table;
